    value: 'This letter is to address the items on the FEC letter dated 12/20/10.
      Item 1: On Sched. A, the aggregate y-t-d totals refer to the donor''s contributions
      to CFG PAC, not to any candidate or committee referenced in memo entries. The
      FECfile software does not allow us to edit this field and all the data was imported
      in the format shown on the instructions for the FECfile software. Item 2: In
      a previous submission to the FEC on 12/21/10, the Club responded to the issue
      of a missing 48 Hour notices explaining a misunderstanding of what triggers
      the $10K threshold. This missing report has the same issue.  As mentioned we
      were under the impression a 48 Hour Report was not yet necessary as we did not
      have $10K in un-reported transactions toward this race. You have now informed
      us that we have misunderstood the rule and have asked that we file the 48 hour
      report which include activities previously reported and are doing so at your
      request.  We will take appropriate steps to ensure this does not happen again
      in the future. Item 3: The transactions in question here actually refer to the
      GA-9 Special-Runoff Election held on 6/8/10. The FECfile software does not give
      the option of listing transactions with this election type, as the closest options
      were Special-General or Runoff.  After speaking with Ms. Sinram, it was recommended
      we change the election type of these transactions to Runoff.

